CREATE TABLE IF NOT EXISTS parsed_advertisements_module.vehicle_models(
    id                   UUID PRIMARY KEY,    
    text                 VARCHAR(50) UNIQUE,
    document_tsvector    TSVECTOR,
    embedding            vector(1024)
);

CREATE INDEX IF NOT EXISTS idx_vehicle_parsed_vehicles_hnsw
    ON parsed_advertisements_module.vehicle_models USING hnsw (embedding vector_cosine_ops);

CREATE INDEX IF NOT EXISTS idx_vehicle_models_document_tsvector
    ON parsed_advertisements_module.vehicle_models USING GIN(document_tsvector);

CREATE INDEX IF NOT EXISTS idx_vehicle_models_text
    ON parsed_advertisements_module.vehicle_models(text);

CREATE OR REPLACE FUNCTION parsed_advertisements_module.update_text_document_tsvector()
RETURNS trigger AS $$
BEGIN
  NEW.document_tsvector := to_tsvector('russian', COALESCE(NEW.text, ''));
RETURN NEW;
END;
$$ LANGUAGE plpgsql;

DO $$
BEGIN
    IF NOT EXISTS (
        SELECT 1 FROM pg_trigger
        WHERE tgname = 'trg_update_vehicle_models_document_tsvector'
        AND tgrelid = 'parsed_advertisements_module.vehicle_models'::regclass
    ) THEN
CREATE TRIGGER trg_update_vehicle_models_document_tsvector
    BEFORE INSERT OR UPDATE ON parsed_advertisements_module.vehicle_models
                         FOR EACH ROW EXECUTE FUNCTION parsed_advertisements_module.update_text_document_tsvector();
END IF;
END
$$;

DO $$
BEGIN
    ON CONFLICT (text) DO NOTHING;
END $$;
